    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE ( col1 ) NOT IN ( - 83, 25 * col1 - - 41 + - col1 + - 37 + - col2 );
  - name: tab0

outputs:
  - name: q1928.out
    data: |
      15	81	47
      87	21	10
      97	1	99
